.qv-st-header-cell-search .lui-icon--search::before {
    color: var(--gray) !important;
} */

.null-value,
.qv-st-data-cell-null-value {
    background-color: var(--grid-background) !important;
}

.qv-st-header-wrapper div.qv-st-header table tbody tr:nth-child(1) span,
.qv-st-header-cell-wrapper .qv-st-value .qv-st-value-overflow {
    text-align: center;
}


