.qv-pt table tr:nth-child(-n + 2):hover,
.qv-st-header-wrapper div.qv-st-header table tbody tr:nth-child(-n + 2) {
    color: var(--gray-dark) !important;
    background-color: var(--grid-background) !important;
    background-image: linear-gradient(to bottom, var(--grid-background), var(--gray-dark));
    border-color: #434F5C !important;
    transition: box-shadow 200ms ease-out;
} */


/* End Table Style */


/* Pivot Table Style */

.qv-pt .lui-button {
    color: var(--gray) !important;
    background-color: var(--grid-background) !important;
    /* color: var(--gray-dark) !important; */
}


